import React, { useEffect } from 'react'
import styled from 'styled-components';

function Chat() {

  const clearStorage = () => {
    console.log("Hi")
    localStorage.removeItem('chat-app-user');
  }

  useEffect(() => {
    console.log(localStorage.getItem('chat-app-user'));
  }, [])

  return (
    <Container>
      <h1>Chat</h1>
      <button onClick={clearStorage}>Log out</button>
    </Container>
  )
}

const Container = styled.div`
  height: 100vh;
  width: 100vw;
  display: flex;
`

export default Chat
